    //for intercepting all XHTTPRequests
    XMLHttpRequest.prototype.realSend = XMLHttpRequest.prototype.send;
    XMLHttpRequest.prototype.send = function(value) {
        this.addEventListener("loadend", function() {
            var message;
            console.log(this);

            if (this.readyState === 4 && this.status===200){
                message = {"message" : "xHttpRequest", "responseURL" : this.responseURL};
            }else{
                message = {"message": "XHTTPRequestError", "errorResponse": this.responseText};
            }

            window.webkit.messageHandlers.UIDAIListener.postMessage(message);
        });

        this.realSend(value);
    };

 (function(){
        var timer = 0;
        var t = setTimeout(() => {
            timer = timer + 1;
            var message;
            if(timer >= 60){
                timer = 0;
                message = {"message": "loadStatus", "statusCode": "001"};
                window.webkit.messageHandlers.UIDAIListener.postMessage(message);
                clearTimeout(t);
                if(document.readyState !== 'complete'){
                    message = {"message": "loadStatus", "statusCode": "000"};
                    window.webkit.messageHandlers.UIDAIListener.postMessage(message);
                }
            }else if (document.readyState === 'complete'){
                timer = 0;
                clearTimeout(t);
                message = {"message": "loadStatus", "statusCode": "001"};
                window.webkit.messageHandlers.UIDAIListener.postMessage(message);
            }

        }, 1000);
    })();

